import React from 'react';
import s from '../../styles.module.css';

const Balance = ({ deposit }) => (
  <section className={s.balance}>
    <span>⬆️$</span>
    <span>⬇️1000$</span>
    <span>Balance: {deposit}$</span>
  </section>
);

export default Balance;
